* {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
}

body {
    font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
    background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
    min-height: 100vh;
    padding: 20px;
}

.login-container {
    display: flex;
    justify-content: center;
    align-items: center;
    min-height: 100vh;
}

.login-form {
    background: white;
    padding: 40px;
    border-radius: 15px;
    box-shadow: 0 10px 40px rgba(0, 0, 0, 0.2);
    width: 100%;
    max-width: 500px;
    text-align: center;
}

.login-form h1 {
    margin-bottom: 20px;
}

.login-form h2 {
    color: #555;
    margin-bottom: 20px;
    font-size: 1.5em;
}

.text-input {
    width: 100%;
    padding: 12px;
    margin-bottom: 15px;
    border: 2px solid #ddd;
    border-radius: 5px;
    font-size: 16px;
    font-family: inherit;
}

.container {
    max-width: 800px;
    margin: 0 auto;
    background: white;
    border-radius: 15px;
    padding: 30px;
    box-shadow: 0 10px 40px rgba(0, 0, 0, 0.2);
    position: relative;
}

.header {
    display: flex;
    justify-content: space-between;
    align-items: center;
    margin-bottom: 30px;
}

.header h1 {
    margin: 0;
}

.user-icon {
    background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
    color: white;
    width: 50px;
    height: 50px;
    border-radius: 50%;
    display: flex;
    align-items: center;
    justify-content: center;
    font-size: 24px;
    cursor: pointer;
    border: none;
    padding: 0;
    transition: transform 0.2s;
}

.user-icon:hover {
    transform: scale(1.1);
}

/* Header Controls */
.header-controls {
    display: flex;
    align-items: center;
    gap: 15px;
}

/* Dark Mode Toggle Switch */
.dark-mode-switch {
    position: relative;
    display: inline-block;
    width: 50px;
    height: 26px;
}

.dark-mode-switch input {
    opacity: 0;
    width: 0;
    height: 0;
}

.switch-slider {
    position: absolute;
    cursor: pointer;
    top: 0;
    left: 0;
    right: 0;
    bottom: 0;
    background-color: #ccc;
    transition: 0.4s;
    border-radius: 26px;
}

.switch-slider:before {
    position: absolute;
    content: "";
    height: 20px;
    width: 20px;
    left: 3px;
    bottom: 3px;
    background-color: white;
    transition: 0.4s;
    border-radius: 50%;
}

.dark-mode-switch input:checked + .switch-slider {
    background-color: #667eea;
}

.dark-mode-switch input:checked + .switch-slider:before {
    transform: translateX(24px);
}


h1 {
    text-align: center;
    color: #333;
    font-size: 2.5em;
}

h2 {
    color: #555;
    margin-bottom: 15px;
    font-size: 1.5em;
}

.add-task-section {
    background: #f8f9fa;
    padding: 20px;
    border-radius: 10px;
    margin-bottom: 30px;
}

#taskTitle, #taskDescription {
    width: 100%;
    padding: 12px;
    margin-bottom: 10px;
    border: 2px solid #ddd;
    border-radius: 5px;
    font-size: 16px;
    font-family: inherit;
}

#taskDescription {
    min-height: 80px;
    resize: vertical;
}

button {
    background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
    color: white;
    padding: 12px 30px;
    border: none;
    border-radius: 5px;
    cursor: pointer;
    font-size: 16px;
    font-weight: bold;
    transition: transform 0.2s;
}

button:hover {
    transform: scale(1.05);
}

button:active {
    transform: scale(0.98);
}

.task {
    background: #fff;
    border: 2px solid #e0e0e0;
    border-radius: 8px;
    padding: 15px;
    margin-bottom: 15px;
    transition: all 0.3s;
}

.task:hover {
    box-shadow: 0 5px 15px rgba(0, 0, 0, 0.1);
    transform: translateY(-2px);
}

.task.completed {
    opacity: 0.6;
    background: #f0f0f0;
}

.task-header {
    display: flex;
    justify-content: space-between;
    align-items: center;
    margin-bottom: 10px;
}

.task-title {
    font-size: 1.2em;
    font-weight: bold;
    color: #333;
}

.task.completed .task-title {
    text-decoration: line-through;
    color: #999;
}

.task-description {
    color: #666;
    margin-bottom: 10px;
    line-height: 1.5;
}

.task-actions {
    display: flex;
    gap: 10px;
}

.task-actions button {
    padding: 8px 15px;
    font-size: 14px;
}

.complete-btn {
    background: linear-gradient(135deg, #11998e 0%, #38ef7d 100%);
}

.delete-btn {
    background: linear-gradient(135deg, #eb3349 0%, #f45c43 100%);
}

#tasksList:empty::before {
    content: "No tasks yet. Add your first task above!";
    display: block;
    text-align: center;
    color: #999;
    padding: 40px;
    font-style: italic;
}

/* Profile Modal Styles */
.profile-modal {
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background: rgba(0, 0, 0, 0.6);
    display: flex;
    justify-content: center;
    align-items: center;
    z-index: 1000;
}

.profile-content {
    background: white;
    padding: 40px;
    border-radius: 15px;
    box-shadow: 0 10px 40px rgba(0, 0, 0, 0.3);
    width: 90%;
    max-width: 500px;
    position: relative;
}

.profile-content h2 {
    text-align: center;
    margin-bottom: 30px;
    color: #333;
}

.close-btn {
    position: absolute;
    top: 15px;
    right: 15px;
    background: #e0e0e0;
    color: #333;
    width: 35px;
    height: 35px;
    border-radius: 50%;
    display: flex;
    align-items: center;
    justify-content: center;
    font-size: 20px;
    cursor: pointer;
    border: none;
    padding: 0;
    transition: background 0.2s, transform 0.2s;
}

.close-btn:hover {
    background: #d0d0d0;
    transform: scale(1.05);
}

.profile-avatar {
    font-size: 80px;
    text-align: center;
    margin-bottom: 20px;
}

.profile-info {
    display: flex;
    flex-direction: column;
    gap: 15px;
}

.profile-field {
    display: flex;
    justify-content: space-between;
    padding: 10px 0;
    border-bottom: 1px solid #e0e0e0;
}

.profile-field:last-child {
    border-bottom: none;
}

.profile-field label {
    font-weight: bold;
    color: #555;
}

.profile-field span {
    color: #333;
}

/* Dark Mode Styles */
body.dark-mode {
    background: linear-gradient(135deg, #1a1a2e 0%, #16213e 100%);
}

body.dark-mode .login-form {
    background: #2d2d44;
    color: #e0e0e0;
}

body.dark-mode .login-form h2 {
    color: #b0b0b0;
}

body.dark-mode .text-input {
    background: #3d3d5c;
    border-color: #4d4d6d;
    color: #e0e0e0;
}

body.dark-mode .container {
    background: #2d2d44;
    color: #e0e0e0;
}

body.dark-mode h1 {
    color: #e0e0e0;
}

body.dark-mode h2 {
    color: #b0b0b0;
}

body.dark-mode .add-task-section {
    background: #252538;
}

body.dark-mode #taskTitle,
body.dark-mode #taskDescription {
    background: #3d3d5c;
    border-color: #4d4d6d;
    color: #e0e0e0;
}

body.dark-mode .task {
    background: #3d3d5c;
    border-color: #4d4d6d;
}

body.dark-mode .task-title {
    color: #e0e0e0;
}

body.dark-mode .task-description {
    color: #b0b0b0;
}

body.dark-mode .task.completed {
    background: #252538;
}

body.dark-mode .task.completed .task-title {
    color: #888;
}

body.dark-mode .profile-content {
    background: #2d2d44;
    color: #e0e0e0;
}

body.dark-mode .profile-content h2 {
    color: #e0e0e0;
}

body.dark-mode .profile-field {
    border-bottom-color: #4d4d6d;
}

body.dark-mode .profile-field label {
    color: #b0b0b0;
}

body.dark-mode .profile-field span {
    color: #e0e0e0;
}

body.dark-mode .close-btn {
    background: #4d4d6d;
    color: #e0e0e0;
}

body.dark-mode .close-btn:hover {
    background: #5d5d7d;
}


